import Title from './Title/index'
import Member from './Member/index'

const Categories = () => {
    return (
        <section id="team" class="team section-bg mt-5">
            <div class="container" data-aos="fade-up">
                <Title />
                <Member />
                <Member />
                <Member />
                <Member />
            </div>
        </section>
    )
}

export default Categories;
